from itertools import chain
from typing import List

class Solution:
    def countSquares(self, matrix: List[List[int]]) -> int:
        
        # DP[y][x] denotes the largest edge length of square, whose bootom right point is [y][x]
        
        # Because update direction is from top to bottom, from left to right.
        # We can update in-place without losing needed information
        # dp_table = [ list(row) for row in matrix ]
        dp_table = matrix
        
        h, w = len(matrix), len(matrix[0])
        
        # Visit each matrix cell, except for row_0 and column_0
        for y in range(1, h):
            for x in range(1, w):
                
                if matrix[y][x]:
                    
                    # Make sure matrixp[y][x] is 1, thus square can cover current matrix cell.
                    # Update largest edge length of sqaure, whose bottom right point is [y][x]
                    
                    dp_table[y][x] = 1 + min(dp_table[y][x-1],dp_table[y-1][x-1],dp_table[y-1][x])
        
        return sum( chain(*dp_table) )



# m : the dimension of column of matrix
# n : the dimension of row of matrix

## Time Complexity: O( m * n )
#
# The overhead in time is the nested loop, which is of O( m * n )

## Space Complexity: O( 1 )
#
# The overhead in space is the loop index and temporary variable for update, which is of O( 1 )



